void mainImage( out vec4 fragColor, in vec2 fragCoord ) { 

    float time =iTime+1.;
    vec2 uv = (fragCoord * 2.0 - iResolution.xy) / iResolution.y;
    float d = length(uv);
    d = pow(d,0.8);
    d =fract((time/6.5)+1192.*sqrt(d*d)*(d*(fract(tan(d)*0.07))))-(abs(uv.y*1.2))*length(uv);

    fragColor = vec4(d*1.9, 0.,0., 1.0);

}
